import { useParams } from "react-router-dom";
import { useSelector } from "react-redux";

export default function Detalle() {
  const { id } = useParams();
  const personajes = useSelector((state) => state.personajes);
  const cache = personajes.find((e) => e.id === Number(id));

  return (
    <div>
        <div>
            <img src={cache.imagen}/>
        </div>
        <div>
            <p>{`id: ${cache.id}`}</p>
            <p>{`nombre: ${cache.nombre}`}</p>
            <p>{`estado: ${cache.status}`}</p>
            <p>{`especie: ${cache.especie}`}</p>
            <p>{`genero: ${cache.genero}`}</p>
            <p>{`origen: ${cache.origen}`}</p>
        </div>
    </div>
  );
}

